import React, { useState } from "react";
import Logo from "../SourceFiles/Header/Logo.png";

function Header() {
  const [Manu, setManu] = useState({
    item: ["Haqq覺m覺zda", "Mentorlar"],
    Account: {
      class: "fas fa-user",
      text: "",
    },
  });

  const [UserClick, setUserClick] = useState(false);

  const userClicked = () => {
    setUserClick((prevState) => !prevState);
  };

  return (
    <div id="header">
      <div id="header-block">
        <div className="container">
          <div id="flexcontainer" className="flex">
            <div id="header-logo">
              <img src={Logo} />
            </div>
            <div id="header-manu">
              <nav>
                <ul className="flex">
                  {Manu.item.map((item) => {
                    return <li>{item}</li>;
                  })}
                  <li className={Manu.Account.class} onClick={userClicked}>
                    {Manu.Account.text}
                  </li>
                </ul>
              </nav>
            </div>
          </div>
        </div>
      </div>
      <div id ='Acc-block'>
          <h4>VTP21</h4>
      </div>
    </div>
  );
}

export default Header;
